import React, { Component } from "react";
import "./nav.css";
export class Nav extends Component {
  render() {
    return (
      <div>
        <header>
          <nav>
            <ul>
              <li>
                <a href="#"> HOME </a>
              </li>

            </ul>
          </nav>
        </header>
      </div>
    );
  }
}

export default Nav;
